import * as React from "react";
import Box from "@mui/material/Box";
import Divider from '@mui/material/Divider';
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemButton from "@mui/material/ListItemButton";
import Typography from '@mui/material/Typography';
import ListItemText from "@mui/material/ListItemText";

export default function Nav() {

    const listItemTextStyles = {
        color: "#1769aa",
        fontSize: "36px",
        textAlign: "center"
    };

    return (
        <Box sx={{width: "100%", bgcolor: "background.paper"}}>
            <nav aria-label="medication nav">
                <List sx={{fontSize: "40px"}}>
                    <Divider/>
                    <ListItem disablePadding>
                        <ListItemButton component="a" href="#" sx={{padding: "40px"}}>
                            <ListItemText disableTypography
                                          primary={<Typography style={listItemTextStyles}>Add a
                                              medication</Typography>}/>
                        </ListItemButton>
                    </ListItem>
                    <Divider/>
                    <ListItem disablePadding>
                        <ListItemButton component="a" href="#" sx={{padding: "40px"}}>
                            <ListItemText disableTypography primary={<Typography
                                style={listItemTextStyles}>Your
                                medications</Typography>}/>
                        </ListItemButton>
                    </ListItem>
                    <Divider/>
                    <ListItem disablePadding>
                        <ListItemButton component="a" href="#" sx={{padding: "40px"}}>
                            <ListItemText disableTypography primary={<Typography
                                style={listItemTextStyles}>Your reminders</Typography>}/>
                        </ListItemButton>
                    </ListItem>
                    <Divider/>
                </List>
            </nav>
        </Box>
    );
}
